#
# TABLE STRUCTURE FOR: balita
#

DROP TABLE IF EXISTS `balita`;

CREATE TABLE `balita` (
  `balita_id` int(255) NOT NULL AUTO_INCREMENT,
  `balita_idpegawai` int(255) DEFAULT NULL,
  `balita_keterangan` text,
  `created-at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`balita_id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

#
# TABLE STRUCTURE FOR: level
#

DROP TABLE IF EXISTS `level`;

CREATE TABLE `level` (
  `level_id` int(11) NOT NULL AUTO_INCREMENT,
  `level_nama` varchar(255) DEFAULT NULL,
  `level_status` bit(1) DEFAULT NULL,
  `created_at` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `level_dashboard` text,
  PRIMARY KEY (`level_id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=12 DEFAULT CHARSET=latin1 ROW_FORMAT=COMPACT;



#
# TABLE STRUCTURE FOR: log
#

DROP TABLE IF EXISTS `log`;

CREATE TABLE `log` (
  `log_id` int(11) NOT NULL AUTO_INCREMENT,
  `log_iduser` int(11) DEFAULT NULL,
  `log_aksi` varchar(100) DEFAULT NULL,
  `created_at` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `log_level` varchar(3) DEFAULT NULL,
  PRIMARY KEY (`log_id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=253 DEFAULT CHARSET=latin1 ROW_FORMAT=COMPACT;



#
# TABLE STRUCTURE FOR: meninggal
#

DROP TABLE IF EXISTS `meninggal`;

CREATE TABLE `meninggal` (
  `meninggal_id` int(11) NOT NULL AUTO_INCREMENT,
  `meninggal_idpegawai` int(255) DEFAULT NULL,
  `meninggal_tanggal` date DEFAULT NULL,
  `meninggal_keterangan` text,
  `created_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`meninggal_id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

#
# TABLE STRUCTURE FOR: menu
#

DROP TABLE IF EXISTS `menu`;

CREATE TABLE `menu` (
  `menu_id` int(11) NOT NULL AUTO_INCREMENT,
  `menu_nama` varchar(255) DEFAULT NULL,
  `menu_ikon` varchar(255) DEFAULT NULL,
  `menu_is_mainmenu` varchar(5) DEFAULT NULL,
  `menu_link` varchar(255) DEFAULT NULL,
  `menu_akses_level` varchar(50) DEFAULT NULL,
  `menu_urutan` int(5) DEFAULT NULL,
  `menu_status` varchar(1) DEFAULT NULL,
  `menu_akses` int(2) DEFAULT NULL,
  `menu_baru` int(2) DEFAULT NULL,
  `menu_label` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`menu_id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=177 DEFAULT CHARSET=latin1 ROW_FORMAT=COMPACT;



#
# TABLE STRUCTURE FOR: norumah
#

DROP TABLE IF EXISTS `norumah`;

CREATE TABLE `norumah` (
  `norumah_id` int(11) NOT NULL AUTO_INCREMENT,
  `norumah_nomor` int(5) DEFAULT NULL,
  `norumah_keterangan` text,
  PRIMARY KEY (`norumah_id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

#
# TABLE STRUCTURE FOR: pendatang
#

DROP TABLE IF EXISTS `pendatang`;

CREATE TABLE `pendatang` (
  `pendatang_id` int(11) NOT NULL AUTO_INCREMENT,
  `pendatang_idwarga` int(255) DEFAULT NULL,
  `pendatang_alamatbaru` text,
  `pendatang_alamatlama` text,
  `created_at` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`pendatang_id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

#
# TABLE STRUCTURE FOR: pendidikan
#

DROP TABLE IF EXISTS `pendidikan`;

CREATE TABLE `pendidikan` (
  `pendidikan_id` int(11) NOT NULL AUTO_INCREMENT,
  `pendidikan_nama` varchar(255) DEFAULT NULL,
  `created_at` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`pendidikan_id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

#
# TABLE STRUCTURE FOR: reg_kegiatan
#

DROP TABLE IF EXISTS `reg_kegiatan`;

CREATE TABLE `reg_kegiatan` (
  `kegiatan_id` int(11) NOT NULL AUTO_INCREMENT,
  `kegiatan_nama` varchar(255) DEFAULT NULL,
  `kegiatan_tanggal` date DEFAULT NULL,
  `kegiatan_tempat` text,
  `created_at` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`kegiatan_id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

#
# TABLE STRUCTURE FOR: reg_registrasi
#

DROP TABLE IF EXISTS `reg_registrasi`;

CREATE TABLE `reg_registrasi` (
  `reg_id` int(11) NOT NULL AUTO_INCREMENT,
  `reg_kegiatanid` int(11) DEFAULT NULL,
  `reg_nama` varchar(255) DEFAULT NULL,
  `reg_email` varchar(50) DEFAULT NULL,
  `reg_notlp` varchar(15) DEFAULT NULL,
  `reg_alamat` text,
  `reg_foto` text,
  `created_at` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`reg_id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=latin1 ROW_FORMAT=COMPACT;

#
# TABLE STRUCTURE FOR: setting
#

DROP TABLE IF EXISTS `setting`;

CREATE TABLE `setting` (
  `setting_id` int(11) NOT NULL AUTO_INCREMENT,
  `setting_namasistem` varchar(255) DEFAULT NULL,
  `setting_namatempat` text,
  `setting_alamat` text,
  `setting_email` varchar(100) DEFAULT NULL,
  `setting_notlp` varchar(20) DEFAULT NULL,
  `setting_logo` text,
  `setting_namapemilik` varchar(100) DEFAULT NULL,
  PRIMARY KEY (`setting_id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=latin1 ROW_FORMAT=COMPACT;



#
# TABLE STRUCTURE FOR: user
#

DROP TABLE IF EXISTS `user`;

CREATE TABLE `user` (
  `user_id` int(11) NOT NULL AUTO_INCREMENT,
  `user_username` varchar(255) CHARACTER SET latin1 DEFAULT NULL,
  `user_password` text CHARACTER SET latin1,
  `user_nama` varchar(255) CHARACTER SET latin1 DEFAULT NULL,
  `user_level` int(5) DEFAULT NULL,
  `user_terdaftar` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `user_email` varchar(100) CHARACTER SET latin1 DEFAULT NULL,
  `user_status` bit(1) DEFAULT NULL,
  `created_at` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `user_foto` text,
  PRIMARY KEY (`user_id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=38 DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT;



#
# TABLE STRUCTURE FOR: warga
#

DROP TABLE IF EXISTS `warga`;

CREATE TABLE `warga` (
  `warga_id` int(11) NOT NULL AUTO_INCREMENT,
  `warga_nomorrumah` varchar(10) DEFAULT NULL,
  `warga_statustempattinggal` varchar(50) DEFAULT NULL,
  `warga_statusktp` varchar(50) DEFAULT NULL,
  `warga_domisili` varchar(50) DEFAULT NULL,
  `warga_jaminankesehatan` varchar(50) DEFAULT NULL,
  `warga_nomorjaminankesehatan` varchar(50) DEFAULT NULL,
  `warga_sktm` varchar(10) DEFAULT NULL,
  `warga_namakeluarga` varchar(200) DEFAULT NULL,
  `warga_alamatnamakeluarga` varchar(100) DEFAULT NULL,
  `warga_nohpkeluarga` varchar(15) DEFAULT NULL,
  `warga_nomorkk` int(100) DEFAULT NULL,
  `warga_nomorktp` int(100) DEFAULT NULL,
  `warga_nama` varchar(150) DEFAULT NULL,
  `warga_hubungankeluarga` varchar(50) DEFAULT NULL,
  `warga_alamatktp` text,
  `warga_jeniskelamin` varchar(50) DEFAULT NULL,
  `warga_tempatlahir` text,
  `warga_tanggallahir` date DEFAULT NULL,
  `warga_nomorhp` varchar(20) DEFAULT NULL,
  `warga_statusnomor` varchar(50) DEFAULT NULL,
  `warga_email` varchar(50) DEFAULT NULL,
  `warga_agama` varchar(50) DEFAULT NULL,
  `warga_golongandarah` varchar(5) DEFAULT NULL,
  `warga_hobi` varchar(255) DEFAULT NULL,
  `warga_statusperkawainan` varchar(50) DEFAULT NULL,
  `warga_pendidikanterakhir` varchar(50) DEFAULT NULL,
  `warga_pekerjaan` varchar(100) DEFAULT NULL,
  `warga_alamatbekerja` text,
  `warga_npwp` varchar(20) DEFAULT NULL,
  `warga_nonpwp` varchar(50) DEFAULT NULL,
  `created_at` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`warga_id`)
) ENGINE=InnoDB AUTO_INCREMENT=166 DEFAULT CHARSET=latin1;



#
# TABLE STRUCTURE FOR: wargakampung
#

DROP TABLE IF EXISTS `wargakampung`;

CREATE TABLE `wargakampung` (
  `warga_id` int(11) NOT NULL AUTO_INCREMENT,
  `warga_nama` varchar(100) DEFAULT NULL,
  `warga_idpendidikan` int(255) DEFAULT NULL,
  `warga_nohp` int(15) DEFAULT NULL,
  `warga_domisili` varchar(255) DEFAULT NULL,
  `warga_norumah` int(255) DEFAULT NULL,
  `created_at` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`warga_id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

